    description: "# Sosivio Operator\nThe Sosivio Operator for RedHat’s Openshift
      Container Platform allows users to quickly and easily deploy Sosivio’s Kubernetes
      Predictive Troubleshooting Platform on your cluster.\n\n# Sosivio Overview\n\nSosivio
      is the first and only non-intrusive and predictive autonomous cloud-native platform
      built specifically for Kubernetes from the ground up. Sosivio provides predictive
      troubleshooting tools, root cause determination and instant remediation for
      any failures in Kubernetes environments.\n\nPredict and Prevent!\n\nThe Operator
      will deploy and manage Sosivio on Kubernetes and OpenShift. Included are the
      following features;\n-   **Root Cause Analysis and Remediation** - predictive
      troubleshooting to prevent failures before they occur. Instantly understand
      where the root cause is and how to fix it.\n-   **Application Profiling** -
      analyze container resource consumption and recommendations for requests and
      limits.\n-   **Real-time Metrics** - in-depth, granular, and accurate real-time
      data from the process level inside containers (and pods) with failure correlation.\n-
      \  **Cluster Health Checks** - proactive health checks for cluster infrastructure
      and applications running on the cluster.\n-   **Multi-Cluster View** - management,
      monitoring, and maintenance capabilities for all clusters from one location.
      \n-   **Kubernetes Components Alerting** - notifications sent through Slack,
      email and other 3rd party platforms.\n\n# Installation\nSosivio is completely
      **non-intrusive** and **does not require any persistent storage**. There is
      **no data offloading** outside of your Kubernetes cluster. Applying our Data
      Swirling methodology enables the product to perform at a **remarkably low resource
      footprint** and requires **no persistent volume configurations**.\n\n\nSosivio
      is installed under one namespace (labeled: \"sosivio\") which creates all the
      required components for the product.\n\nAll users will start with 4 weeks of
      Sosivio Premium after which Sosivio will automatically convert to the Community
      Version (free forever).\n\n# Help\nMore information about Sosivio and our product
      usage instructions can be found in our documentation [here](https://docs.sosiv.io/)
